import Button from '@mui/material/Button';
import styled from 'styled-components';

const ButtonS = styled(Button).attrs((props) => ({
  disableRipple: true,
}))`
  && {
    background-color: var(--text-secondary);
    color: var(--accent);
    /* Add any other custom styles */
  }
`;

export default ButtonS;
